import { Injectable } from "@angular/core";
import { EmployeModel } from "../models/employe-model.model";
import * as data from '../data/data.json'

@Injectable({
  providedIn: 'root'
})

export class DataService
{
  private rawData!: any

  constructor(){
    this.rawData = data
  }

  getData(): any {
    return this.rawData
  }

}
